function Headbar(){
    return (
        <div>
        <header className="bg-white shadow">
        <nav className="container mx-auto px-6 py-3">
            <p className="text-gray-800 text-xl font-bold md:text-2xl hover:text-gray-700" >To do List</p>
        </nav>
        </header>
        </div>
        );  
}
export default Headbar
